import React from "react";

//files

class ViewStudents extends React.Component {
  constructor(props) {
    super(props);
    this.state = { students: null };
  }
  render() {
    return (
      <div>
        <div class="container">
          <input
            placeholder="Search using JobTitle or Company Name"
            class="search-box"
            onKeyUp={e => this.searchTerm(e)}
            type="text"
          ></input>
        </div>
      </div>
    );
  }
}

export default ViewStudents;
